"use client"
import React from "react"
import styles from "./HeroCourses.module.scss"
import { useLocale, useTranslations } from "next-intl"
import { FaArrowUp } from "react-icons/fa"

function HeroCity() {
  const t = useTranslations("hero.city")
  const handleScroll = () => {
    const element = document.getElementById("cityPage")
    if (element) {
      element.scrollIntoView({ behavior: "smooth" })
    }
  }
  const locale = useLocale()
  return (
    <>
      <section className={styles.hero}>
        <div className={styles.content}>
          <h1>{t("title")}</h1>
          <p>{t("subtitle")}</p>
        </div>
        <div className={styles.cta}>
          <button onClick={handleScroll} className={styles.searchButton}>
            <span>{t("searchPlaceholder")}</span>
            <FaArrowUp />
          </button>
        </div>
        <div className={`${styles.svg}  ${locale === "ar" && styles.svgLeft}`}>
          <svg
            width="408"
            height="333"
            viewBox="0 0 408 333"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink">
            <rect width="408" height="366" fill="url(#pattern0_112_6864)" />
            <defs>
              <pattern
                id="pattern0_112_6864"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1">
                <use
                  xlinkHref="#image0_112_6864"
                  transform="matrix(0.000739548 0 0 0.000825083 -0.0627306 -0.124587)"
                />
              </pattern>
              <image
                id="image0_112_6864"
                width="1500"
                height="1500"
                preserveAspectRatio="none"
                xlinkHref="data:image/png;base64,"
              />
            </defs>
          </svg>
        </div>
      </section>
    </>
  )
}

export default HeroCity
